import React from 'react';
import PetCard from '../components/PetCard';

const dummyPets = [
  { id: 1, name: 'Luna', breed: 'Labrador', age: 3, photo: 'https://via.placeholder.com/150' },
  { id: 2, name: 'Max', breed: 'Bulldog', age: 5, photo: 'https://via.placeholder.com/150' },
];

export default function Pets() {
  return (
    <div>
      <h2 className="mb-4">Mis Mascotas</h2>
      <div className="row">
        {dummyPets.map(pet => (
          <div className="col-md-4 mb-3" key={pet.id}>
            <PetCard pet={pet} />
          </div>
        ))}
      </div>
    </div>
  );
}
